import React, { useState, useEffect } from "react";
import ReactDOM from "react-dom";
import { Row, Col, Container, Card } from "react-bootstrap";
import { NavbarComp, ListKategori, Hasil } from "./component/index";
import { API_URL } from "./utils/constants";
import axios from "axios";

const App = () => {
	const [menus, setMenus] = useState();

	useEffect(() => {
		axios
			.get(API_URL + "products")
			.then((response) => {
				// handle success
				setMenus(response.data);
			})
			.catch((error) => {
				// handle error
				console.log(error);
			});
	}, []);

	console.log(menus);

	return (
		<>
			<div className="App">
				<NavbarComp />
				<div className="mt-3">
					<Container fluid>
						<Row>
							<ListKategori />
							<Col>
								<h4>
									<strong>Daftar Produk</strong>
								</h4>
								<hr />
								<Row>
									{menus &&
										menus.map((menu) => {
											return (
												<Card
													style={{ width: "18rem" }}
												>
													<Card.Img
														variant="top"
														src="holder.js/100px180"
													/>
													<Card.Body>
														<Card.Title>
															Card Title
														</Card.Title>
														<Card.Text>
															Some quick example
															text to build on the
															card title and make
															up the bulk of the
															card's content.
														</Card.Text>
														<Button variant="primary">
															Go somewhere
														</Button>
													</Card.Body>
												</Card>
											);
										})}
								</Row>
							</Col>
							<Hasil />
						</Row>
					</Container>
				</div>
			</div>
		</>
	);
};

export default App;
